import React from 'react';
import bg from "../img/info-bg.jpg";
import '../App.css';

const Infodemo = ()=> {
        return (
            <>
               <div className='container-fluid info-demo-container'>
                    <img className='img img-fluid' src={bg} />
                    <div className='info-textbox'>
                        <h1 className='info-text'>Hello Mr. <span>Anuj Verma</span></h1>
                        <h2>Welcome to RoomOrent</h2>
                    </div>
                </div> 
            </>
        )
}

export default Infodemo;
